Upon the occurrence of any event listed below, this Agreement may be terminated at the discretion of either Party without prior notice or liability, unless otherwise specified in writing by the non-terminating Party:

a) Material breach of this Agreement by the other Party which remains uncured for a period of thirty (30) days after written notice from the non-breaching Party;
